import React from "react";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./LargeButton";
import face from "./fb.png";
import twit from "./twitter.png";
import part from "./web.png";
import LargeButton from "./LargeButton";
import FooterHeaderBtns from "./FooterHeaderBtns"
import "./Footer.css"

class Footer extends React.Component {

    render() {
        const fb = {
            src: face,
            alt: "facebook"
        }
        const twitter = {
            src: twit,
            alt: "twitter"
        }
        const partners = {
            src: part,
            alt: "partners"
        }
        return (

            <footer style={{ height: this.props.height }}>
                <div className="tekst">
                    <HorizontalnaLista
                        prvi={<FooterHeaderBtns value="ABOUT"/>}
                        drugi={<FooterHeaderBtns value="TEAM"/>}
                        treci={<FooterHeaderBtns value="CONTACT"/>}
                        prviLink="/about"
                        drugiLink="/team"
                        treciLink="/contact"
                    />
                </div>
                <div className="ikone">
                    <HorizontalnaLista
                        prvi={<Ikona url={fb.src} alt={fb.alt} width={this.props.iconSize} height={this.props.iconSize} />}
                        drugi={<Ikona url={twitter.src} alt={twitter.alt} width={this.props.iconSize} height={this.props.iconSize} />}
                        treci={<Ikona url={partners.src} alt={partners.alt} width={this.props.iconSize} height={this.props.iconSize} />}
                    />
                </div>
            </footer>);
    }


}

export default Footer;
